"MSG_APIACCOUNTCREATION_BODY" => "感谢您注册PamFax开发者项目. 账户已为您创建，您即刻便能对丰富的PamFax API资源进行研究了.\n\n您现在可以登录<a href=\"https://sandbox-apifrontend.pamfax.biz\">PamFax API前台系统</a>页面来访问文档, 下载样例代码并测试这些API.\n\n您的API授权证书内容包括:\nAPI开发授权密钥: {apikey}\nAPI对外设置密钥: {apisecret}\n\n请注意, 此沙盒型数据库不储存来自真实系统环境的任何数据. 它是独立系统. 沙盒API不提供真正地发送传真功能. 作为随机处理, 处于此沙盒环境中的您的一些传真也会发送失败, 而这样做的目的就是让您测试失败事例.  尽管传真永远不会被真实地发送, 但大部分传真都将会被此系统报告为成功发送了.\n这一特性也应用到了沙盒环境中的PamFax点数设置上 - 它就是虚拟货币. 您则可以借助此功能将真实环境中的PamFax点数添加进您的测试账户中, 按您的意思购买/添加点数给用户.  之后您可以使用PamFax点数测试发送过程状态. 当然, 我们也提供测试传真号码以便您可以测试接收传真功能.\n\n我们已在运行系统和沙盒系统中为您创建了一个用于测试用途的新的带有PamFax点数的共用账户:\nAPI用户名: {username}\n密码: {password}\n\n一旦您完成了开发工作，请将方案描述及其部分截图通过devsupport@pamfax.biz发给我们. 我们将复核您的方案并使其可访问我们的现有产品系统.\n\n需要帮助? 没问题, 我们为此创建了<a href=\"https://groups.google.com/d/forum/pamfax-api-partners\">PamFax API开发者全适用邮件列表</a>页面用于求助. 对于PamFax账户寻求一对一支持或问题求助, 您只需通过<a href=\"mailto:devsupport@pamfax.biz\">devsupport@pamfax.biz</a>发送邮件给我们即可.",
