"MSG_BASICPLAN_PURCHASED" => "恭喜您, 您订购的PamFax基本计划已激活, 它将用于接下来的{months}个服务月.\n\n\n\n一旦您的传真号码可以接收传真了您将会立即接收到另外一条带有您传真号码的对话消息和/或电子邮件.\n\n\n\n您的收益:\n\n- {months}个月的订购内容\n\n- 免费且无限次传真接收\n\n- 对已发送和已接收传真提供30天存储\n\n- 随时随地无广告\n\n\n\n订购计划将在{expiredate}过期. 系统将在过期前自动通知您以便您可以续订PamFax计划并保留您的传真号码. \n\n计划的过期将不会影响到您账户中的PamFax点数或发送传真的功能. 计划作为独立订购内容存在, 它并不关联您账户中的PamFax点数. 请注意您可以在您的信用卡声明的交易部分看到有\"GTS Pamela. Nicosia\"字样. 这是完整的合乎程序的且它是关于PamFax的交易.",
