"MSG_PLAN_EXPIRATION_WARNING_EMAIL_1" => "您上次订购的保留您传真号码<b>{number}</b>的PamFax计划将在<b>{days_to_expiration}天后过期</b> (过期时间为{expiration_date}). \n\n\n\n要保持您的PamFax传真号码有效, 请现在就遵照如下这些简单步骤来续订您的PamFax订购:\n\n\n\n1. 在PamFax入口页面https://portal.pamfax.biz登录\n\n\n\n2. 在其顶部位置您将看到您的PamFax传真号码(s), 在它下面您将看到一个带有\"续订我的订购\"字样的链接\n\n\n\n3. 点击此链接并按照步骤执行\n\n\n\n4. 完成支付后您的传真号码就是续订的了, 您会在PamFax入口页面看到有变更 \n\n\n\n于是您的传真号码({number})就可用于包括无限次传真接收服务在内的另一轮3个月或12个月(取决于您的订购种类)的有效期了.\n\n\n\n系统将会在过期时间前7天再次提醒您.\n\n\n\n注意: 计划的过期将不会影响到您账户中的PamFax点数或发送传真的功能. 计划作为独立订购内容存在, 它并不关联您账户中的PamFax点数.",
"MSG_PLAN_EXPIRATION_WARNING_EMAIL_2" => "您上次订购的保留您传真号码<b>{number}</b>的PamFax计划将在<b>{days_to_expiration}天后过期</b> (过期时间为{expiration_date}). \n\n\n\n要保持您的PamFax传真号码有效, 请现在就遵照如下这些简单步骤来续订您的PamFax订购:\n\n\n\n1. 在PamFax入口页面https://portal.pamfax.biz登录\n\n\n\n2. 在其顶部位置您将看到您的PamFax传真号码(s), 在它下面您将看到一个带有\"续订我的订购\"字样的链接\n\n\n\n3. 点击此链接并按照步骤执行\n\n\n\n4. 完成支付后您的传真号码就是续订的了, 您会在PamFax入口页面看到有变更 \n\n\n\n于是您的传真号码({number})就可用于包括无限次传真接收服务在内的另一轮3个月或12个月(取决于您的订购种类)的有效期了.\n\n\n\n注意: 计划的过期将不会影响到您账户中的PamFax点数或发送传真的功能. 计划作为独立订购内容存在, 它并不关联您账户中的PamFax点数.",
"MSG_PLAN_EXPIRATION_WARNING_EMAIL_3" => "您上次订购的保留您传真号码<b>{number}</b>的PamFax计划将在<b>48小时后过期</b>. 这是系统发送给您的<b>最后一封通知邮件</b>!\n\n\n\n要保持您的PamFax传真号码有效, 请现在就遵照如下这些简单步骤来续订您的PamFax订购:\n\n\n\n1. 在PamFax入口页面https://portal.pamfax.biz登录\n\n\n\n2. 在其顶部位置您将看到您的PamFax传真号码(s), 在它下面您将看到一个带有\"续订我的订购\"字样的链接\n\n\n\n3. 点击此链接并按照步骤执行\n\n\n\n4. 完成支付后您的传真号码就是续订的了, 您会在PamFax入口页面看到有变更 \n\n\n\n于是您的传真号码({number})就可用于包括无限次传真接收服务在内的另一轮3个月或12个月(取决于您的订购种类)的有效期了.\n\n\n\n如果48小时后您没有采取任何举措, 您的<b>个人传真号码{number}将从您的PamFax账户中被永久移除</b>.\n\n\n\n注意: 计划的过期将不会影响到您账户中的PamFax点数或发送传真的功能. 计划作为独立订购内容存在, 它并不关联您账户中的PamFax点数.",
