"MSG_WELCOME_FAX" => "您好,\n\n<br><br>\n\n<p>感谢您安装PamFax客户端应用.</p>\n\n<p>系统已向您发送了第一封传真以此来展示您的传真号码可用. 您现在可以开始使用PamFax收发传真了.</p><br>\n\n<p>PamFax将为您提供下述收益:</p><br>\n\n<ol>\n\n<li>适用于Microsoft Windows, Mac OSX, Android, iOS和Blackberry平台的免费应用</li>\n\n<li>在Windows平台下可通过在Outlook 2007/2013版PamFax轻松地发送传真</li>\n\n<li>可直接使用Dropbox, Google Drive, OneDrive和Box网盘传真文档</li>\n\n<li>以便宜的费率发送传真到世界各地</li>\n\n<li>您可以使用预付款点数包随使用随支付</li>\n\n<li>您的PamFax点数永不过期!</li>\n\n<li>所有信息都采用了端到端的加密方式. 您的文档是安全的</li>\n\n<li>公平坦诚的订购条款, 也即, 我们不人为的对客户的一切行为开据账单!</li>\n\n</ol><br>\n\n<p>通过向您的朋友们推荐PamFax可获得额外的免费传真页. 对于每一位注册了的推荐人系统会自动为其账户中添加一页免费传真页. 推荐功能对于PamFax应用客户端而言, 在您发送一封传真后便可以使用了, 或者可以直接通过PamFax入口页面使用. 您推荐的人越多您所获得的免费传真页也就越多!</p><br>\n\n<p>我们希望您喜欢我们的服务. 如果您有任何问题请不要犹豫, 可通过www.pamfax.biz网站上的支持菜单联系我们或联系support@pamfax.biz给我们发邮件.</p>\n\n<br>\n\n奉上最诚挚的问候,<br><br>\n\nPamFax团队",
