"SHOP_PLAN_NOTICE" => "<b>给PamFax专业计划订购者的重要提示:</b><br>\n如果您正在购买一份PamFax点数包并且您的PamFax专业计划是激活状态, 那么系统将仅添加您购买的票面点数到您的账户中, 而<b>没有</b>附赠点数. 原因是您已经是以最低价格计划来发送传真了.",
"SHOP_PRODUCT_OVERVIEW" => "<h3>PamFax产品概述</h3><br>\n您在下面将找到当前可用的产品. 其中的某些产品售价会在我们的标准传真页的定价模式之上为您提供大幅折扣.<br><br>点击产品以获取进一步详情.<br><br>购买流程简单, 只需点击您所选择的产品之后按照支付步骤操作即可. 支付成功后点数包或传真计划将自动添加到您的PamFax账户中. 之后就可开启PamFax应用查看并使用您的点数了.<br><br><span style=\"font-weight: bold;\">重要提示:</span> 大数额的预付点数包(€250起步)仅适用于已验证客户. 请阅读<a href=\"{website_url}KB226\">关于此编号的知识库条目</a>来了解关于如何获得验证的解释.",
"SHOP_PROPLAN_FULL_DESCRIPTION" => "我们的专业计划仅以€5.95/月起步. 包括可将您自己的带有本地区号的传真号码用于<span style=\"font-weight: bold;\">无限次</span>传真接收. 可从<span style=\"font-weight: bold;\"><a href=\"/fax-number\">众多国家之一</a>选择一个号码作为您的使用号码.</span><br>\n每月可免费发送最多20页免费传真页(发送给1区接收地, 其它区更少)!<br>\n<br>\n如果您每年需要发送的传真页数多于240页, 可使用我们为用户提供的带有折扣率的专业计划发送传真们. 请<a href=\"/rates/costs/?plan=pro\">点击此处</a>了解我们为使用专业计划的用户提供的超低价格.<br>\n<br>\n要在商务中使用PamFax? 没问题, 您可使用免费的PamFax公司管理者账户来管理所有您商务中的用户. 行使权限有分配PamFax点数, 存取传真和分享传入传真.",
"SHOP_PROPLAN_HIGHLIGHTS" => "<br />以低价提供全特性\n<ul style=\"margin-left: 14px;\">\n<li>可使用您自己的本地区传真号码</li>\n<li>免费且无限次传真接收</li>\n<li>每月可免费发送20页传真页</li>\n<li>可享有大约30%的单页低价优惠(可参阅<a href=\"/rates/costs/?plan=pro\" target=\"_blank\">价格</a>页面)</li>\n<li>传真历史永不过期</li>\n<li>与公司管理者分享一个传真号码和PamFax点数</li>\n<li>无广告</li>\n<li>发送失败的传真将不收费</li>\n</ul>",
"SHOP_PROPLAN_SHORT_DESCRIPTION" => "PamFax专业订购<span style=\"font-weight: bold;\">包括有可使用<a href=\"/fax-number\">来自多个国家</a></span>的一个传真号码. 可享有无限次免费传真接收和每月可发送最多<b>20页免费传真页</b>(发送给1区).",
