"SITE_ADDONS_ADDONS_TEXT_COMPANY_MANAGER" => "如果您正在公司环境中使用PamFax, 那么我们为公司管理者提供了免费的PamFax. 这种服务允许您集中管理自己的PamFax用户组. 例如, 您可以购买PamFax点数, 之后将PamFax点数分配给您的员工 (甚至当您员工的点数过低时它还能自动为其分配点数). 您也可以下放权利给员工, 让他们除了能访问交易数据和发票外, 还能访问传真收件箱.",
"SITE_ADDONS_ADDONS_TEXT_FACEBOOK" => "如果您正在定期使用Facebook, 那么您真的应该安装Facebook版的免费PamFax应用. 它允许您直接从Facebook轻松发传真以及访问您的传真历史和收件箱.",
"SITE_ADDONS_ADDONS_TEXT_OFFICE" => "[p]Windows版PamFax提供了适用Word, Excel和PowerPoint的扩展, 允许您直接从Microsoft Office传真文档, 工作表, 演示文稿, 图表和项目. [strong]只需打开文件, 点击【发送传真】[/strong] (工具栏中), 然后输入收件人凭证, 现在您就可以发传真了![/p]\n[p]Windows版PamFax也含有免费的Outlook扩展, 它也允许您直接从Outlook发送传真. 您可以选择发送电子邮件文本, 文本和附件或只是附件. 如果您已经在系统中安装了Outlook, 那么安装Windows桌面版的PamFax应用就会自动安装Outlook扩展.[/p]",
"SITE_ADDONS_ADDONS_TEXT_SALESFORCE" => "如果您正在使用Salesforce,  那么我们的PamFax应用可以使您直接从Salesforce访问PamFax. 它可以使您访问自己的PamFax传真历史, 只需一键操作便可将传真发送给您Salesforce中的任何联系人.",
"SITE_ADDONS_ADDONS_TEXT_ZIMBRA" => "Windows版PamFax也包含适用Zimbra Desktop的Zimlet扩展. 该扩展的工作方式与Outlook扩展相同. 通过您联系人列表中的传真号码, 就可以直接从Zimbra Desktop非常容易地传真电子邮件和/或附件. 如果您已经在系统中安装了Zimbra Desktop, 那么安装Windows桌面版的PamFax应用就会自动安装Zimbra扩展.",
"SITE_ADDONS_COMPANY_HEAD" => "PamFax- 商务传真服务",
"SITE_ADDONS_COMPANY_SUBHEAD" => "使用公司管理者管理所有PamFax用户",
"SITE_ADDONS_COMPANY_TEXT" => "[p]PamFax的【公司管理者】功能允许您创建组账户. 您唯一需要做的就是激活PamFax专业计划订购. 添加附加用户到公司管理者账户是[b]免费[/b]的. 您添加的用户可以拥有基本或专业计划, 不过这不是必须要添加的.[/p]\n[p]您可以邀请PamFax用户加入这个组. 然后您可以给他们分配PamFax点数以及与该组成员分享传入传真. 您也可以为每个用户设置点数自动追加特性来确保他们有足够的点数发送传真. 或者与该组成员分享一个或多个传真号码, 之后这些人也可以访问所有的传入传真.[/p]\n[p]您可以通过点击下面的[b]【[BTN_INSTALL]】[/b]轻松创建免费的管理员账户.[/p]",
"SITE_ADDONS_FACEBOOK_HEAD" => "Facebook的PamFax扩展",
"SITE_ADDONS_FACEBOOK_SUBHEAD" => "随时查看您的传真历史 - 直接在Facebook中",
"SITE_ADDONS_FACEBOOK_TEXT" => "[p]这一免费的扩展被安装在了您的Facebook账户中, 在它连接到PamFax之后, 便可直接将您的传真历史显示在您的Facebook主页上. 它的安装是非常简单的, 只需点击下方的[b]【[BTN_INSTALL]】[/b]链接. 安装完它后您还需要在Facebook中完成接下来的步骤.[/p]\n[p]在Facebook中您会在自己的应用列表中看到有链接,  通过它您可以访问传真历史. 这里显示了您的全部传真历史. 正如您在下面看到的, 您可以接着查看传真详情, 发送新传真以及直接访问PamFax入口.[/p]",
"SITE_ADDONS_SALESFORCE_HEAD" => "Salesforce版PamFax",
"SITE_ADDONS_SALESFORCE_TEXT" => "[p]这一扩展被安装在了您的Salesforce.com账户中, 在它连接到PamFax入口系统之后, 便可在PamFax标签页内显示您的传真历史了. 它的安装是十分容易的, 只需点击下方的[b]【[BTN_INSTALL]】[/b]即可. 安装完它后您会在Salesforce.com中看到接下来的步骤. 完成它们之后就可以使用了. [/p]\n[p]在标签页内您可以访问传真历史. 这里的内容是直接从您的入口页面读取的. 正如您在下面看到的, 在该页面上您可以接着查看传真详情, 发送新传真以及访问完整的入口页面.[/p]",
"SITE_BTN_ADD_FACEBOOK" => "添加到Facebook",
"SITE_BTN_ADD_SALESFORCE" => "添加到Salesforce",
"SITE_BTN_CALCULATE" => "计算",
"SITE_BTN_LEARN_MORE" => "了解更多",
