"SITE_BTN_READ_MORE" => "了解更多",
"SITE_BTN_RESTORE" => "恢复",
"SITE_BTN_SEE_HERE" => "请看这",
"SITE_BTN_SEND_FREE_FAX" => "发送免费传真",
"SITE_BTN_SHOW_PLANS" => "显示提供的计划",
"SITE_BTN_SHOW_PRICING" => "显示定价",
"SITE_BTN_SIGNUP_NOW" => "现在注册",
"SITE_BTN_START_COMPANY" => "创建公司账户",
"SITE_DEVELOPER_HOWTO_BLOCK_CURRENCIES_HEAD" => "API中的货币",
"SITE_DEVELOPER_HOWTO_BLOCK_CURRENCIES_TEXT" => "PamFax内部按欧元执行. 所有的价格, 点数等等都按EUR计. API返回的货币值也一直都按欧元计, 例外情况是当有用户登录(通过Session::VerifyUser)且该用户拥有不同的按他的配置设置的货币. 那么所有的货币值都按用户的币种返回. 也就是如果没有用户登录或如果登录用户将EUR设置为他的币种, 那么NumberInfo::GetPagePrice将按欧元返回传真的价格(【priceperpage】字段). 当有将USD设置为自己币种的用户登录时, 【priceperpage】将按USD返回 (按当前的货币兑换从EUR转换为USD). 如果您需要PamFax使用的货币汇率列表, 那么只需调用Common::ListCurrencies即可. 用户的点数也按用户币种返回. API会为您将内部使用的EUR值转换为正确的币种值. 这可能会导致当兑换率改变的时候用户的点数会日复一日的变化. 但是因为发送传真的价格也将按相同的汇率计算, 所以用户总是能准确地获得应付的传真页价格.",
"SITE_DEVELOPER_HOWTO_BLOCK_DATES_HEAD" => "API中的日期",
"SITE_DEVELOPER_HOWTO_BLOCK_DATES_TEXT" => "日期/时间值总是以标准的24小时日期格式返回, 也就是FaxHistory::ListInboxFaxes的【接收时间】字段可以看作[2009-04-24 22:44:11]. 时区的所有时间字段都是基于用户设置或您的API账户设置的全局时区计算的. 也就是我们已将您的API账户设置为【亚洲/东京】时区 (请联系我们以便我们能设置您账户中的时区). 之后传真被创建. 它将获得按【亚洲/东京】时区值计算的【创建时间】字段值, 而不是我们服务器的时间.",
"SITE_DEVELOPER_HOWTO_BLOCK_DIRECTAPI_HEAD" => "直接API",
"SITE_DEVELOPER_HOWTO_BLOCK_DIRECTAPI_TEXT_1" => "PamFax API是HTTPS GET/POST类型API, 它返回XML或JSON响应. 参数借助POST方法传递且必须由依赖给定参数的校验和验证. 每个调用都必须包含一个参数, 由它来识别调用方以确保安全. URL的调用后跟API处理程序和方法名称. 您可以指定返回值如何由特殊参数[apioutputformat]编码. 它可以是[API_FORMAT_XML]或[API_FORMAT_JSON]. 在该文档中我们只给出了XML格式的响应, 因为它是API的默认配置.",
"SITE_DEVELOPER_HOWTO_BLOCK_DIRECTAPI_TEXT_2" => "在响应例子中您会看到名为[UserToken]的标签. 这是非常重要的, 因为必须提交多个调用给API用以识别某个调用要执行的PamFax用户. 例如, FaxJob/Create调用就需要经验证的PamFax用户来执行.",
"SITE_DEVELOPER_HOWTO_BLOCK_DISTRIBUTE_HEAD" => "分发您的解决方案",
"SITE_DEVELOPER_HOWTO_BLOCK_DISTRIBUTE_TEXT" => "商业化您的集成 – 您准备推出商用的PamFax集成吗? 您这么做无需任何附加费用 – 在您的解决方案中使用PamFax API是免费的. 一旦您完成了集成您就可以将该解决方案提交给我们用以认证. 这是免费的且认证成功后您就能使用我们提供的API凭证访问生产用API",
"SITE_DEVELOPER_HOWTO_BLOCK_GETSTART_HEAD" => "PamFax API入门指南",
"SITE_DEVELOPER_HOWTO_BLOCK_GETSTART_TEXT" => "[p]PamFax的入门是很容易的. API的访问和使用是很容易且免费的. 点击下方的[b]【[BTN_SIGNUP]】[/b]发简介告诉我们您打算如何使用PamFax, 我们就会立即发送给您沙盒API的登录详情. 该环境为您提供了所有文档和API访问, 因此您可以开始集成工作了. 沙盒的作用就像是真实的生产用API. 该沙盒甚至能为您随机生成传真投递错误以方便您测试错误的处理.[/p]\n[p]一旦您打算真正使用它, 那只需将有关您解决方案的简介(以及少量截屏)发送给我们. 之后我们就会发送给您真实的生产用API密钥以便您可以真正将它用于生产.[/p]\n[p]您能用两种方式为我们的传真服务付费. 您既可以预先加载自己的账户, 使用足够的点数为自己的客户提供传真服务户, 从而以此作为您解决方案的一部分; 您又可以选择告知自己的客户让他们自己购买所需点数. 这两种情况中, PamFax API都会为您提供价格和页面信息以方便您跟踪计费以及通知自己用户的花费.[/p]",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_APPSTACK" => "应用套件",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES" => "API特性",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_1_HEAD" => "常用命令",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_1_TEXT" => "提供与全局信息有关的功能, 像系统状态, 支持的文件类型等等.",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_2_HEAD" => "传真历史",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_2_TEXT" => "传真历史的访问 (收件箱, 发件箱和已发送传真).",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_3_HEAD" => "传真作业",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_3_TEXT" => "提供创建, 管理和发送传真的功能.",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_4_HEAD" => "号码信息",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_4_TEXT" => "提供有关电话号码的功能, 像特殊号码的定价, 地区费率信息等等.",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_5_HEAD" => "会话",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_5_TEXT" => "提供与会话处理, 链接, 登录/退出, 用户验证等等有关的功能.",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_6_HEAD" => "商业信息",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_6_TEXT" => "提供处理购买项目, 优惠券, 发票, 定价信息等等的功能.",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_7_HEAD" => "用户信息",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_FEATURES_7_TEXT" => "提供检索有关用户, 设置, 配置, 历史等等的信息的功能.",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_HEAD" => "PamFax API技术概述",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_TEXT" => "PamFax API由以下组件构成",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_TEXT_TIP_1" => "PamFax应用服务器 – 服务器管理着所有的传真过程和相关数据. 现在, 这意味着我们将数据托管在了我们的高可靠性数据中心. 依托了强大服务器平台的文档转换服务器也属于该环境的一部分.",
"SITE_DEVELOPER_HOWTO_BLOCK_OVERVIEW_TEXT_TIP_2" => "XML API – 我们设计了高度灵活的基于XML标准的API, 它能快速集成PamFax. PamFax的XML API是一种编程HTTPS请求的简单方式, 它会给出简单的XML响应.",
"SITE_DEVELOPER_HOWTO_BLOCK_SECUREAPI_HEAD" => "API调用安全",
"SITE_DEVELOPER_HOWTO_BLOCK_SECUREAPI_TEXT_1" => "[p]所有API的调用都由校验和参数确保安全. 这就保证了从您的应用到PamFax API这一路的调用不被更改. 您必须要计算该值, 所以让我们看一下它的实现:[/p]\n[p]function calculate_api_checksum[/p]",
"SITE_DEVELOPER_HOWTO_BLOCK_SECUREAPI_TEXT_2" => "PHP中的参考实例可以在API客户参考实例(PHP)中的apiclient.php文件中找到 (请看CalcApiCheck功能)",
"SITE_DEVELOPER_HOWTO_BLOCK_SECUREAPI_TIP_1" => "必须[不]包含如下参数: page, event, apikey, apicheck, usertoken",
"SITE_DEVELOPER_HOWTO_BLOCK_SECUREAPI_TIP_2" => "除非特别说明, 否则必须包含'apioutputformat'参数.",
"SITE_DEVELOPER_HOWTO_BLOCK_SECUREAPI_TIP_3" => "如果值为布尔型则需要检查 ([真]取为1, [假]取为0)",
"SITE_DEVELOPER_HOWTO_BLOCK_SECUREAPI_TIP_4" => "如果值为数组则需要循环. 与值配对的键需要被转换为小写字母且值必须依照它是键的情况按字母顺序排序 (像2)和3)的情况).",
"SITE_DEVELOPER_HOWTO_BLOCK_USEAPI_HEAD" => "使用API",
"SITE_DEVELOPER_HOWTO_BLOCK_USEAPI_TEXT_1" => "您可以使用两种方式将自己的软件连接到PamFax: 您既可以自己写代码让它通过HTTPS XML与API通信(请看下面), 又可以从这些库中挑选一种来使用",
"SITE_DEVELOPER_HOWTO_BLOCK_USEAPI_TEXT_2" => "您可以在[a][b]范例页面[/b][/a]或登录PamFax API前台(需要免费PamFax API账户, 下方注册)查看范例代码",
"SITE_DEVELOPER_HOWTO_BLOCK_USEAPI_TIP_1" => "PHP客户参考实例",
"SITE_DEVELOPER_HOWTO_BLOCK_USEAPI_TIP_2" => "C# .NET SDK实例",
"SITE_DEVELOPER_HOWTO_BLOCK_USEAPI_TIP_3" => "Java SDK实例",
"SITE_DEVELOPER_HOWTO_BLOCK_USEAPI_TIP_4" => "Python库 (致谢[b]Dynaptio[/b])",
"SITE_DEVELOPER_HOWTO_BLOCK_USEAPI_TIP_5" => "Ruby库 (致谢[b]Tropo[/b])",
"SITE_DEVELOPER_HOWTO_FOOTER" => "注册免费的PamFax API账户",
"SITE_DEVELOPER_HOWTO_HEAD" => "免费PamFax API",
"SITE_DEVELOPER_HOWTO_SUBHEAD" => "PamFax API对于开发者是完全免费的. 容易部署传真服务且无需费用.",
"SITE_DEVELOPER_INTRO_BLOCK_HEAD_1" => "介绍",
"SITE_DEVELOPER_INTRO_BLOCK_HEAD_2" => "我能构建什么?",
"SITE_DEVELOPER_INTRO_BLOCK_HEAD_3" => "注册免费的API访问",
"SITE_DEVELOPER_INTRO_BLOCK_HEAD_4" => "技术支持",
"SITE_DEVELOPER_INTRO_BLOCK_TEXT_1" => "[p]PamFax开发者计划现已创建, 它源自我们心系的简单愿景: 我们想让开发者将PamFax特性添加到他们已有的软件, 硬件或基于web的应用中成为可能.[/p]\n[p]我们通过创建一种简单易用的开发者框架实现了这一目标, 反过来它也使创建PamFax的聚合应用变得很容易.[/p]\n[p]此API是标准的HTTPS XML(或JSON), 所有我们自己的应用也都使用这一相同的API – 获得所有PamFax功能![/p]",
"SITE_DEVELOPER_INTRO_BLOCK_TEXT_2" => "[p]收发传真 – 您在PamFax应用中看到的所有功能都可以被添加进到您的解决方案. 这就意味着它也能实现收发传真, 错误管理, 群发以及更多的功能.[/p]\n[p]构建您自己的用户入口 – 就像PamFax入口, PamFax API也能提供给您所有的入口功能. 您能为自己的用户提供全部权限.[/p]\n[p]改善您解决方案的吸引力 – PamFax API是一种添加传真功能的理想手段, 它能提高您解决方案的吸引力. 例子有在CRM系统中集成, 支持在文档管理解决方案中发送传真以及更多功能. 借助已添加的PamFax功能, 您的解决方案将能为您的用户提供更高的效率.[/p]",
"SITE_DEVELOPER_INTRO_BLOCK_TEXT_2_TIP_1" => "将传真的收发功能到您应用的工作流.",
"SITE_DEVELOPER_INTRO_BLOCK_TEXT_2_TIP_2" => "提供给用户传真历史并允许传真的下载保存为PDF格式.",
"SITE_DEVELOPER_INTRO_BLOCK_TEXT_2_TIP_3" => "管理您PamFax账户里的用户.",
"SITE_DEVELOPER_INTRO_BLOCK_TEXT_2_TIP_4" => "提供用户访问个人文件夹的权限.",
"SITE_DEVELOPER_INTRO_BLOCK_TEXT_3" => "[p]入门真的很容易 – 访问和使用API对于您和您的客户都是免费的. 只有发送传真是收费的, 传真接收也是免费的. 点击下方的[b]【[BTN_START_API]】[/b], 填写表格, 完成后我们会立即发送给您登录凭证, 您就可以用它来访问API的完整文档.[/p]",
"SITE_DEVELOPER_INTRO_BLOCK_TEXT_4" => "[p]PamFax API问题跟踪器托管在[a:google]Google Code[/a]上, 在这里您可以发表有关PamFax API的漏洞或问题.[/p]\n[p]PamFax也托管在[a:mashape]Mashape[/a]上, 请看[/p]",
"SITE_DEVELOPER_INTRO_HEAD" => "免费PamFax API",
"SITE_DEVELOPER_INTRO_SUBHEAD" => "PamFax API对于开发者是完全免费的. 容易部署传真服务且无需费用.",
"SITE_DEVELOPER_REFERENCES_HEAD" => "免费PamFax API",
"SITE_DEVELOPER_REFERENCES_SUBHEAD" => "PamFax API对于开发者是完全免费的. 容易部署传真服务且无需费用.",
"SITE_DEVELOPER_REFERENCES_TEXT_FOOTER" => "成为下一位成功的合作伙伴! 也成为合作伙伴",
"SITE_DEVELOPER_REFERENCES_TEXT_INTRO_HEAD" => "支持使用PamFax API的解决方案",
"SITE_DEVELOPER_REFERENCES_TEXT_INTRO_TEXT" => "这些合作伙伴已经构建了借助PamFax API收发传真的成功解决方案.",
"SITE_DEVELOPER_REFERENCES_TEXT_READDLE" => "完整的文档和文件管理解决方案.[LF]解决方案: PamFax集成了iPhone版Scanner Pro应用, 可轻松传真由iPhone相机生成的任何文档.",
"SITE_DEVELOPER_REFERENCES_TEXT_TROPO" => "一种由Tropo开发的Ruby库(GEM)可以调用PamFax API发送传真. 它存放在rubygems.org上. 只需使用简单的命令【gem install pamfaxr】便可安装. pamfaxr是遵循MIT许可发布的开源程序. 源代码存放在[a][strong]GitHub[/strong][/a]上.",
"SITE_DEVELOPER_SAMPLES_BLOCK_BASH_HEAD" => "BASH SDK范例",
