rtschaftsraum zuvor gekürzt. Nur in Ausnahmef?llen wird die volle IP-Adresse an einen Server von Google in den USA übertragen und dort gekürzt. Im Auftrag des Betreibers dieser Website wird Google diese Informationen benutzen, um Ihre Nutzung der Website auszuwerten, um Reports über die Websiteaktivit?ten zusammenzustellen und um weitere mit der Websitenutzung und der Internetnutzung verbundene Dienstleistungen gegenüber dem Websitebetreiber zu erbringen. Die im Rahmen von Google Analytics von Ihrem Browser übermittelte IP-Adresse wird nicht mit anderen Daten von Google zusammengeführt. Sie k?nnen die Speicherung der Cookies durch eine entsprechende Einstellung Ihrer Browser-Software verhindern; wir weisen Sie jedoch darauf hin, dass Sie in diesem Fall gegebenenfalls nicht s?mtliche Funktionen dieser Website vollumf?nglich werden nutzen k?nnen. Sie k?nnen darüber hinaus die Erfassung der durch das Cookie erzeugten und auf Ihre Nutzung der Website bezogenen Daten (inkl. Ihrer IP-Adresse) an Google sowie die Verarbeitung dieser Daten durch Google verhindern, indem sie das unter dem folgenden Link verfügbare Browser-Plugin herunterladen und installieren (http://tools.google.com/dlpage/gaoptout?hl=de).</p>\n\n\n\n<p><strong>管理信息</strong> <strong> 管辖权问题</strong></p>\n\n\n\n<p>此站点由PamConsult Software-Beratungsgesellschaft mbH管理和运营. PamConsult不对站点内的材料在您所在地区使用的适法性或有效性发表任何说明. 如果且在某种程度上当地法律是适用的, 那些选择从任意位置访问此站点的人们应主动且有责任遵守当地法律. 我们直言不对我们链接的网站上的内容负责以及这些链接被提供用于情报目的且您自己承担使用它们的风险. 我们不对论坛或任何像但不限于Twitter, Facebook, 等等社交平台上的注册或非注册用户张贴的内容承担任何负责.</p>\n\n\n\n<p><strong>赔偿</strong></p>\n\n\n\n<p>您同意保障并使PamConsult, 和其子公司, 分支机构, 官员, 代理人, 联合品牌创建者或其他合作伙伴, 和员工, 免受任何索赔或要求的损害, 包含适当的律师公费, 由任何第三方造成的或出自您提交, 张贴到站点或经由站点传播的内容, 您的站点使用, 您的站点连接, 您的使用条款违规, 或您的关于他人或实体的任何权益的侵犯.</p>\n\n\n\n<p><strong>管辖法律</strong></p>\n\n\n\n<p>通过访问此站点, 您和PamConsult都同意了所有与您对此站点的访问, 或此站点的使用的相关事宜, 应受德国法律制约并依照德国法律解释, 不予任何法律冲突的原则生效. 既不受制于公约 (CISG) 也不受制于任何其它现有的或将来的双边或国际条约, 即使已实施进德国法律, 仍然适用.</p>\n\n\n\n<p><strong>商标</strong></p>\n\n\n\n<p>显示在此站点上的商标, 标识和服务标志 (\"标志\") 是PamConsult或其它第三方的财产. 您在没有得到PamConsult或此类可拥有标志的第三方的事先书面同意的情况下不允许使用标志. PamConsult, PamConsult标识都属于PamConsult的商标.</p>\n\n\n\n<p><strong>传真隐私</strong></p>\n\n\n\n<p>PamConsult承认文档包含专属和保密信息. PamConsult同意秘密保存文档并采取合理的预防措施确保数据被安全地存储, 未授权的人将不能访问这些文档也不能制作未授权拷贝. 出于隐私的原因, 除了专业计划订购者保留的传真历史, 已发送传真将会在一个月后从您的传真历史中自动被删除. 如果您需要这些传真, 您有义务下载它们的拷贝. PamFax应用和我们的服务器之间的通信完全由SSL协议加密.</p>\n\n\n\n<p><strong>支付</strong></p>\n\n\n\n<p>您应该通过相应的支付处理公司 (Gate2Shop, Paypal或其它有效的支付公司), 通过任何按照在网站上规定的与您的相应产品或服务购买有关的适用税率支付PamConsult.</p>\n\n\n\n<p><strong>退款</strong></p>\n\n\n\n<p>当您直接从PamConsult购买付费产品时您有权在十五(15)天 (“冷却期”)的期限内做取消决定, 但要除了您以任何方式使用过了此付费产品的情况, 这种情况下冷却期将被废止以及您的购买也不能被取消或退款. 过了冷却期, 除了已使用或已过期的产品, 只有订购项是可退款的. PamFax点数支出, 传真号码的分配, 或任何订购数额方面的使用都属于付费产品的“使用”. 您特此明确同意冷却期结束前传真号码可以被分配. 冷却期和退款不适用于的付费产品有 (i) 通过PamConsult的第三方合作伙伴购买的 (请直接联系合作伙伴, 可由其自己决定是否支付退款), (ii) 不直接从PamConsult在线获得 (例如, 优惠券或预付卡) 和 (iii) 由PamFax 公司管理者账户管理员支付并由其分配到您的PamConsult账户. 如果您认为PamConsult收费有误, 您必须在此笔费用被收取的90天内联系PamConsult. 超过90天的任何费用都不能被追回. 如果PamConsult有理由相信 (i) 您正试图不公平利用此退款政策, 例如, 关于相同产品作出重复的退款请求; (ii) 如果您违反这些条款或 (iii) 如果PamConsult有理由怀疑您正在不正当地我们的产品或软件 或怀疑您的用户账户正被第三方不正当地使用; PamConsult将保留拒绝退款请求的权利. 此退款政策将不影响您的法定权益.</p>\n\n\n\n<p><strong>价格</strong></p>\n\n\n\n<p>我们的价格适用于传送时间少于60秒的传真页, 它涵盖了大约90%的传真页. 传真, 不管大小, 其发往的号码过程所用传送时间多于60秒/页就将被添加进\"慢速传真号码列表\". 下次您发往相同的号码时, 被添加到规定价格上的额外费用将基于最后一次传送速度换算. 如果传真在60秒/页限时内被发送, 额外费用的退款会在传真作业完成后发布. 没有特价优惠适用. 德国19%增值税(VAT)可适用于所有随您居住国家而定的价格.</p>\n\n\n\n<p><strong>价格变更</strong></p>\n\n\n\n<p>PamConsult可以在任何时候通过在网站 www.pamfax.biz 上给出一份三十(30)天的此类变更通知, 或通过规定与您的购买有关的新价格来变更价格. 新价格将会在调整已发布于网站之后应用到您的下一次购买中. 您同意通过继续使用PamFax来跟随价格调整, 接受新价格. 如果您不希望接受此类价格调整, 您可以对您的PamFa点数要求退款 (只有非重激活点数是可以退款的).</p>\n\n\n\n<p><strong>支付和关税问题</strong></p>\n\n\n\n<p>PamFax点数: 您需要为使用某些产品而付费. 要购买可付费产品, 您需要有充足的PamFax点数余额, 它是由您 (或PamFax公司管理者账户的管理员)从PamConsult购买的并分配给您的用户账户 (\"PamFax点数\")的点数. 您必须储备充足的PamFax点数在您的用户账户中, 储备方式有通过您的借记卡或信用卡, PayPal账户, 促销券, 或其它可以被PamConsult接受的方式. PamConsult保留停止接受来自一个或多个发行机构的借记卡或信用卡的权利. - 限制: PamConsult不保证您能够使用您的PamFax点数余额购买所有可付费产品. 某些产品可能不得不单独支付. 闲置PamFax点数: 如果您在180天的期限内都没有使用您的PamFax点数, 我将把您的PamFax点数设置为闲置状态. 您可以通过登录您的账户并打开PamFax入口页面来重激活PamFax点数. 重激活不收费. PamConsult不为您重激活PamFax点数. 重激活的PamFax点数是不可退款的. 注册PamFax所得点数奖励: PamConsult可提供给您一份注册奖励. 它是一种在账户创建后就自动添加到您的PamFax账户的不能退还成金钱数额的点数. 奖励点数由PamConsult自主提供且可以更改或移除.</p>\n\n\n\n<p><strong>服务的公平使用</strong></p>\n\n\n\n<p>在PamConsult发现或怀疑站点和/或服务有不公平使用的情况下, 我们将保留在任何时间更改, 修改, 暂停或中断用户访问站点和/或服务任何部分的权利. 我们可以在不给通知或不负责的情况下给某些特性强加限制或限制您访问部分或整个站点和/或服务. PamFax不对失败的传真收费 - 除外情况 - 除了当免费点数被用于支付的情况 (当前适用于初始注册点数和推荐点数). 当系统遇到其它错误或与PamFax系统有关的错误时, 要么传真将被再次发送要么总支付金额将被自动退还 (除了用免费点数支付的时候). 公平使用政策适用于失败传真的发送 - 一旦达到失败传真投递的某一级别在作业中的所有未来失败的传真就会被要求按比例为其付费. 只有失败的场合有通信费用产生才会被要求为其付费.</p>\n\n\n\n<p><strong>传真号码使用的附加条款</strong></p>\n\n\n\n<p>1. 您传真号码的分配. 如果您已购买且有资格持有传真号码, 它将会在您付款给我们后被尽快地分配给您. 在某些国家, 可以由PamConsult的合作伙伴替代其自身来为您分配号码且您可能需要与此类合作伙伴履行单独的协议. 您承认并理解号码的分配与发放不等同于任何财产或关于传真号码(s)的其它权益的任何转让.</p>\n\n\n\n<p>2. PamFax公司管理者. 如果传真号码由管理员分配给您, 那么使用传真号码的权利和此类权利的取消也将由管理员自行运用. PamConsult会尝试分配和发放请求的号码并通过PSTN传真机使您获得可用的传真号码. 然而, PamConsult不能保证请求的传真号码(s)可以被分配或发放给您或不能保证使用此号码可利用PamConsult服务.</p>\n\n\n\n<p>3. 传真号码的终止. PamConsult有权在任何时间以任何理由拒绝, 变更或终止分配给您的任何传真号码, 包含但不限于: (i) 如果您不遵守这些服务条款或任何适当的附加条款; (ii) 如果您不遵守任何PamConsult给出的说明和/或其与产品相关的合作伙伴依照的下面第5段内容; 和/或 (iii) 如果传真号码由任何PamConsult合作伙伴以任何理由收回, 终止或变更 .</p>\n\n\n\n<p>4. 万一PamConsult变更了其已经分配给您的传真号码, PamConsult将会通过邮件和/或对话消息发送通知, 陈述此变更和您的传真号码的生效日期. 如果您不希望接受此新传真号码, 您有权以书面形式或通过给sales@pamhelp.com发送邮件传达将被分配给您的新传真号码的生效日期的信息来终止您的传真号码.</p>\n\n\n\n<p>5. 您的合作 - 您同意您愿意: (i) 遵守PamConsult给出的任何合理说明或PamConsult合作伙伴关于传真号码(s)和产品的使用包含但不限于遵守PamConsult合作伙伴的任何服务条款; (ii) 提供关于您的居住地和您传真号码(s)使用的精确且完整信息, 以及PamConsult偶尔正当要求的那些其它信息.</p>\n\n\n\n\n<p>© 2006-2014 PamConsult Software-Beratungsgesellschaft mbH 最新修订: 2012年10月19日</p>",
